import React from 'react'

export const Header = () => {
  return (
    <div className='w-full flex justify-between items-center p-5 bg-indigo-50 shadow-xl'>
        <div className='logo'>
            <span className='text-gray-200 text-2xl font-bold flex justify-start items-center'></span>
        </div>
    </div>
  )
}
